1.Pneumatic type, faʻatinoga mautu, maualalo le pisa;
2.Automatic fafaga o rivet faapitoa, foia le saoasaoa o le fafagaina o tusi lesona ma faʻaleleia le gaosiga lelei;fai le tagata fa'afoe e aloese mai le manu'a, sili atu le saogalemu;
3.With vibrating fata ipu;Ole saoasaoa o le fafagaina o le ipu vibrating e mafai ona fetuutuunai e tusa ai ma le saoasaoa o le gaioiga a le tagata faigaluega;
4. Saosaoa galuega vave (50-80 taimi i le minute),
5.High galue lelei: o le lelei o le 3-5 taimi o le fa
... 
faʻalua faʻapipiʻi o foliga eseese, e pei o le lapotopoto, afa-taamilosaga, cone, sikuea, mushroom, pakete ma isi;
8.E faigofie ona faʻaogaina, pe a maua le masini, naʻo le manaʻomia e faʻafesoʻotaʻi i le eletise ona mafai lea ona faʻaoga saʻo;
9.E faʻaaogaina vaega pneumatic, faʻatinoga mautu, sili atu le umi;
10.Easy e faʻatonu ma tausia, ma o le faʻatinoga e saogalemu ma faʻalagolago.O le toilalo e le faigofie ona tupu;sili atu ona fetuutuunai ma faigofie le faagaoioiga, faasaoina o le taimi 
...
ute).Malosiaga galue maualuga;Fa'atinoga mautu;
14.Suitable mo le sapalai eletise i itulagi eseese & atunuu.Fesoʻotaʻiga maualuga: e mafai ona faʻaogaina lapoʻa eseese o rivets i luga o le masini lava e tasi, e ala i le na o le suia o le faʻaogaina o meaʻai ma le seti mate.
Fa'ata'ita'iga: JZ-989NMQ
Rivet ulu lapoa:6-15mm
Rivet diameter: 3-5mm
Rivet umi:3-12mm
Fa'a'i loloto:130mm
Saosaoa: 50-80 taimi / minute
Malolosi:220V 50Hz
Tele masini: 790*670*1400mm3
mamafa mama/ mamafa atoa: 130KG / 180KG

O se tamai fale mafanafana o se mea matagofie tele mo se Kerisimasi . E mafai ona e vavaeina se fale faapena oe mai se lagona susulu.
Toga fale i luga o le laau ma ou lima - o se vasega matua
Le faia o se fale tatou te manaʻomia:
- lagona le lanumoana, paʻepaʻe, mumu ma le lanu piniki;
- seleulu;
- pepa ma se penitala mo se mamanu;
- sintepon;
- nila;
- filo;
- kilipa piniki, lanu meamata ma lanu mumu;
- lanu samasama, lanu mumu, lanu uliuli ma lanu piniki;
- lanu moana lanumoana.
Taualumaga:
- 
... 
o le a vavae ese i le lanumoana. O le tasi faamalama e faia i le lanu piniki. O le a vavae ese le faitotoa mai le mumu. E lua vaega o le taualuga ma le kiona o le a vavae ese i se paepae paepae.
- O auʻiliʻiliga o le taualuga e valiina i auiliiliga lanumoana o puipui.
- Matou te taina se kiona i le tasi puipui.
- I le itu e tasi i le puipui e tasi tatou te lalagaina ai se faitotoa lanumumu.
- I le pito i luga, matou te lalagaina le faamalama ma filo lanu mumu ma faʻalanoa i luga laina o loʻo faʻ
...
u uli, tatou te taloina o tatou gutu ma suisui se isu mai le moli eleni. Matou te lalagaina se kiona i luga o kulimi e faia i laumei lanumumu ma pulu.
- I luga o le faitotoa, matou te viliina laumei lanumeamata ma pulu samasama.
- O le lipine lanumoana e 19 cm le umi ma gaugau faalua ma suisui i luga o le fale mai tua.
Ua saunia se fale mo le teuteuina o se Kerisimasi. Maota e mafai ona eseese lanu - lanu samasama, mumu, lanumeamata, moli. O fale lapopoa o le a foliga matagofie i le Tausaga Fou.
